import React, { Component } from 'react';
import './aarohan.css';


class Aarohan extends Component {



 
    render() { 
        return (
          <div class="aar">
          
  <div class="content">
          <figure class="red frame">
          <img src="" alt=""/>
          
         
        </figure>
        <figure class="red frame1">
        <img src="" alt=""/>
        
       
      </figure>
      <figure class="red frame2">
      <img src="" alt=""/>
      
     
    </figure>
    <figure class="red frame3">
    <img src="" alt=""/>
    
   
  </figure>
  <figure class="red frame4">
  <img src="" alt=""/>
  
 
</figure>
</div>
</div>
       
         );
    }
}
 
export default Aarohan;
